import React from "react";
import styled from "styled-components";

const CardBox = styled.div`
    width: 300px;
    height: 100px;
    background-color: #f2f2f2;
`;

const Title = styled.div`
    color: black;
`;

const Image = styled.div``;

const Description = styled.div``;

function Card({title}) {
  return (
    <CardBox>
      <Title>{title}</Title>
    </CardBox>
  );
}

export default Card;
